import React from 'react'
import { useGetTypesQuery } from '../../redux/api/server.api'
import './typesNavigation.scss'
interface typesNavProps{
    setType:(id:number)=> void
    type:number,
}

export default function TypesNavigation({setType,type}:typesNavProps) {
    const {data:Types,isLoading}:any = useGetTypesQuery('')


    if(isLoading){
        return <p>fdsfs</p>
    }
  return (
    <div className='typeNavigation'>
      {Types.map((el:any)=>
      <div className='typeNavigation_wrap'>
        <li className={type == el.id ? 'typeNavigation_el typeNavigation_el-active' : 'typeNavigation_el'} onClick={(e)=>setType(el.id)}>{el.name}</li>
        </div>
      )}
    </div>
  )
}
